import styled from "styled-components"
export const Container=styled.div`
    max-width: 768px;
    margin: 0 auto;
`

const FlexBox = styled.div`
    display: flex;
    align-items: center;
    justify-content: space-between;
`
export const ProfileWrapper= styled(FlexBox)`
    width: 95%;
    & img{
        border-radius: 50%;
        width: 50px;
        height: 50px;
        overflow: hidden;

    }
`
export const ProfileName=styled.p`
    color: #A1927F;
`
export const AttendacneBT=styled.div`
    border: 1px solid #A1927F;
    border-radius: 5px;
    font-size: 16px;
    color: #CB9B55;
    cursor: pointer;
    padding: 6px 15px;
`
